INSERT INTO `field_data_body` VALUES ('node', 'movie', '0', '1', '1', 'und', '0', 'Movie', '', 'filtered_html');
INSERT INTO `field_data_body` VALUES ('node', 'people', '0', '2', '2', 'und', '0', 'Leonardo DiCaprio is an American actor whose portrayal of doomed suitor Jack Dawson in Titanic (1997) made him a generation\'s definition of a heartthrob. Throughout his career, DiCaprio has demonstrated a high level of dramatic versatility, from his breakout film role as a mentally-challenged teenager in ¿A quién ama Gilbert Grape? (1993), through his work with Martin Scorsese in Gangs of New York (2002) and Infiltrados (2006). More recently, DiCaprio earned critical notice for his starring roles in Christopher Nolan\'s Origen (2010) and J. Edgar (2011), for which he received a Golden Globe nomination.\r\n\r\nBorn in 11 November, 1974 in Los Angeles, California, DiCaprio is the only child of former comic book artist George DiCaprio and Irmelin DiCaprio. His parents signed him with a talent agent when he was a child, and DiCaprio began appearing on a number of television commercials and educational shows. Although the budding actor had small roles in such TV series as \"Roseanne\" (1988) and \"La nueva Lassie\" (1989), DiCaprio\'s made his film debut in Critters 3: La venganza (1991), a low-budget horror movie.\r\n\r\nIn 1992, DiCaprio joined what became the final season of \"Los problemas crecen\" (1985), playing a homeless boy who was invited to move in with the Seavers. The sitcom\'s cancellation coincided with an upswing in his career, including the starring role in the film adaptation of Jim Carroll\'s Diario de un rebelde (1995) and his heightened portrayal of Romeo in Baz Luhrmann\'s Romeo y Julieta de William Shakespeare (1996). Although DiCaprio\'s Romeo raised his profile with audiences, his turn in the box office record-breaking Titanic (1997) graduated the actor to A-list status.\r\n\r\nThe majority of DiCaprio\'s post-Titanic career demonstrates a high level of selectivity in his choices. In addition to numerous collaborations with Scorsese, DiCaprio has also starred in films directed by Steven Spielberg (Atrápame si puedes (2002)), Ridley Scott (Red de mentiras (2008)), and Sam Mendes (Revolutionary Road (2008)), in roles that encompass a wide emotional and dramatic range. This continues to be the case, evident in his upcoming film appearances as a mustache-twirling villain in Django desencadenado (2012), soon to be followed by his performance as tragic literary character Jay Gatsby in El gran Gatsby (2013).\r\n\r\nDiCaprio is passionate about environmental and humanitarian causes, having donated $1,000,000 to earthquake relief efforts in 2010, the same year he contributed $1,000,000 to the Wildlife Conservation Society.', '', 'filtered_html');

